import React from "react";
import { View, StyleSheet } from "react-native";

import Text from "../Text";

function LevelCard({ number, onPress }) {
	return (
		<View style={styles.container}>
			<Text>{number}</Text>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {},
});

export default LevelCard;
